    "# How Does a Bike-Share Navigate Speedy Success?\n",
    "\n",
    "This is a case study provided through the \"Google Data Analytics Professional Certificate\" which is based on the case study \"'Sophisticated, Clear, and Polished’: Divvy and Data Visualization\" written by Kevin Hartman (found here: https://artscience.blog/home/divvy-dataviz-case-study). \n",
    "\n",
    "# Introduction\n",
    "Cyclistic is a bike-share company that was launched in 2016. Since then, Cyclistic has grown tremendously with over 5,000 bikes and 600 ports across Chicago. Bikers have the option of single-ride passes, full-day passes, and annual memberships where they are able to unlock bikes from one station and lock them to a different station.\n",
    "\n",
    "# The Opportunity for Growth\n",
    "Although the variation in pricing-plans originally attracted customers, it has come to a conclusion, by financial analysts, that growing the number of annual members is going to result in a successful future. Bikers who use single-ride passes and full-day passes are labeled as casual riders. Instead of broadening the market to new users, Cyclistic has outlined their goal to convert casual riders to become annual members.\n",
    "\n",
    "# Approach\n",
    "To achieve this goal, we must dive deeper into understanding how annual members and casual riders use Cyclistic differently. The results of this analysis will produce marketing strategies that the Cyclistic executive board will feel confident in pursuing due to supporting facts.\n",
    "\n",
    "# About The Data\n",
    "The analysis will be produced from Cyclistic’s historical trip data from the past 12 months, which includes datasets from the months of June 2022-May 2023. The datasets are organized by ride id and entails detailed information of the type of bike used, when and where the ride started, when and where the ride ended, and whether or not the rider is a member or casual rider. I've provided a link to a brief change log of said data (found here: https://docs.google.com/document/d/19LDSWxxlrhb4LL3Yd0IAtKvkLOlsFIvTxCFBWWQDkNQ/edit?usp=sharing).\n",
    "\n",
    "# Analysis\n",
    "In this analysis, I aimed to understand how casual riders and members utilize Cyclistic differently. To answer this question, several variables were examined: average ride length and the number of rides on different days of the week and different hours of the day. By observing and analyzing these trends, I sought to gain insights into the distinct usage patterns of casual riders and members.\n",
    "\n",
    "The analysis focused on the average ride length on different days of the week for both casual riders and members. This variable was examined to determine if there were any variations in ride duration based on the user type. Additionally, the number of rides on different days of the week was considered, as it provides an understanding of the frequency of bike usage among casual riders and members. Both trends are provided below."
   ]
