   "source": [
    "# Calculate mean of usertype and ride length\n",
    "mean_result <- aggregate(ride_length ~ member_casual, data = trips, FUN = mean)\n",
    "colnames(mean_result) <- c(\"User Type\", \"Mean Ride Length\")\n",
    "mean_result\n",
    "\n",
    "# Calculate median of usertype and ride length\n",
    "median_result <- aggregate(ride_length ~ member_casual, data = trips, FUN = median)\n",
    "colnames(median_result) <- c(\"User Type\", \"Median Ride Length\")\n",
    "median_result\n",
    "\n",
    "# Calculate max of usertype and ride length\n",
    "max_result <- aggregate(ride_length ~ member_casual, data = trips, FUN = max)\n",
    "colnames(max_result) <- c(\"User Type\", \"Max Ride Length\")\n",
    "max_result\n",
    "\n",
    "# Calculate min of usertype and ride length\n",
    "min_result <- aggregate(ride_length ~ member_casual, data = trips, FUN = min)\n",
    "colnames(min_result) <- c(\"User Type\", \"Min Ride Length\")\n",
    "min_result"
   ]
  },
