   "source": [
    "#Visualize average ride length vs day of the week by user type with a line chart\n",
    "ggplot(avg_ride_length, aes(x = factor(day_of_week, levels = c(\"Sunday\", \"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\")), y = ride_length, color = member_casual, group = member_casual)) +\n",
    "  geom_line() +\n",
    "  labs(x = \"Day of the Week\", y = \"Average Ride Length\", color = \"User Type\") +\n",
    "  scale_x_discrete(limits = c(\"Sunday\", \"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\")) +\n",
    "  theme_minimal()"
   ]
