   "source": [
    "#Visualize average ride length vs day of the week by user type with a bar chart\n",
    "ggplot(avg_ride_length, aes(x = day_of_week, y = ride_length, fill = member_casual)) +\n",
    "  geom_bar(stat = \"identity\", position = \"dodge\") +\n",
    "  labs(x = \"Day of the Week\", y = \"Average Ride Length (seconds)\", fill = \"User Type\", title = \"Average Ride Length by User Type and Day of the Week\") +\n",
    "  scale_x_discrete(limits = c(\"Sunday\", \"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\")) +\n",
    "  theme_minimal()"
   ]
