   "source": [
    "#Visualize number of rides vs day of the week by user type with a bar chart\n",
    "trips %>%\n",
    "  mutate(weekday = day_of_week) %>%\n",
    "  group_by(member_casual, weekday) %>%\n",
    "  summarise(number_of_rides = n(),\n",
    "            average_duration = mean(ride_length)) %>%\n",
    "  arrange(member_casual, weekday) %>%\n",
    "  ggplot(aes(x = weekday, y = number_of_rides, fill = member_casual)) +\n",
    "  geom_col(position = \"dodge\") +\n",
    "  labs(x = \"Day of the Week\", y = \"Number of Rides\", fill = \"User Type\", title = \"Number of Rides by User Type and Day of the Week\") +\n",
    "  scale_x_discrete(limits = c(\"Sunday\", \"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\")) +\n",
    "  theme_minimal()"
   ]
