   "source": [
    "ride_length_summary <- trips %>%\n",
    "  mutate(started_at = mdy_hm(started_at),  # Convert to date-time format\n",
    "         hour = hour(started_at)) %>%\n",
    "  group_by(member_casual, hour) %>%\n",
    "  summarise(average_rides = mean(ride_length))\n",
    "\n",
    "sorted_data <- ride_length_summary %>%\n",
    "  arrange(hour, member_casual)\n",
    "sorted_data"
   ]
  },
