   "source": [
    "# Print the min and max ride lengths for casual and members for hours of the day\n",
    "min_max_data <- sorted_data %>%\n",
    "  group_by(member_casual) %>%\n",
    "  summarise(min_ride_length = min(average_rides),\n",
    "            max_ride_length = max(average_rides))\n",
    "\n",
    "# Using ride_length_summary\n",
    "min_max_data <- ride_length_summary %>%\n",
    "  group_by(member_casual) %>%\n",
    "  summarise(min_ride_length = min(average_rides),\n",
    "            max_ride_length = max(average_rides))\n",
    "\n",
    "min_max_data"
   ]
  },
