   "source": [
    "#Visualize average ride length vs hour of the day by user type with a bar chart\n",
    "trips %>%\n",
    "  mutate(started_at = mdy_hm(started_at),  # Convert to date-time format\n",
    "         hour = hour(started_at)) %>%\n",
    "  group_by(member_casual, hour) %>%\n",
    "  summarise(average_rides = mean(ride_length)) %>%\n",
    "  ggplot(aes(x = hour, y = average_rides, fill = member_casual)) +\n",
    "  geom_col(position = \"dodge\") +\n",
    "  labs(x = \"Hour of the Day\", y = \"Average Ride Length\", fill = \"User Type\") +\n",
    "  theme_minimal()"
   ]
