   "source": [
    "#Visualize number of rides vs hour of the day by user type with a line chart\n",
    "trips %>%\n",
    "  mutate(started_at = mdy_hm(started_at),  # Convert to date-time format\n",
    "         hour = hour(started_at)) %>%\n",
    "  group_by(member_casual, hour) %>%\n",
    "  summarise(number_of_rides = n()) %>%\n",
    "  ggplot(aes(x = hour, y = number_of_rides, color = member_casual, group = member_casual)) +\n",
    "  geom_line() +\n",
    "  labs(x = \"Hour of the Day\", y = \"Number of Rides\", color = \"User Type\", title = \"Number of Rides by User Type and Hour of the Day\") +\n",
    "  theme_minimal()"
   ]
  }
